The Day Has Come is the debut album of singer-songwriter/guitarist Cheyenne Kimball. The lead single off the album, entitled &quot;Hanging On&quot;, peaked at number 53 on the Billboard Hot 100. The album was released on July 11, 2006. Kimball co-wrote all the songs featured on the album. The album debuted at #15 on the Billboard 200 selling 40,000 copies in the first week. Miley Cyrus covered the song &quot;Four Walls&quot; on her second studio album Breakout.

Cheyenne Nichole Kimball (born July 27, 1990) is an American singer-songwriter and guitarist. Her debut album, The Day Has Come was released in July 2006 coinciding with an MTV reality series following her entry into the music industry. This album produced a chart single on the Billboard Hot 100 in &quot;Hanging On.&quot; Since 2008, she has also been a member of the country music band Gloriana, which made its chart debut in 2009. Cheyenne also dated American Idol season 7 finalist Jason Castro, as he was seen throughout her show.


